import { Link } from "react-router-dom";

export default function NavBar() {
    return (
        <nav className="navbar"> 
        <div className="logo">Save Your Novels</div>
            <Link to="/">Home</Link>
            <Link to="/library">Library</Link>
            <Link to="/search">Search Novels</Link>
        </nav>
    );
}
